import React from "react";
import { useParams } from "react-router-dom";
import students from "../data/students";

const StudentDetailPage = () => {
  // any JS code goes here
  const { id } = useParams();
  const student = students.find((data) => data.studentId === Number(id));
  if (!student) return <h1>Student does not exist!</h1>;
  return (
    <React.Fragment>
      <h1>This is student with ID = {id} is {student.firstName} {student.lastName} in {student.school} </h1>
    </React.Fragment>
  );
};

export default StudentDetailPage;
